import "./MatchingResultPage.css";
import React, { useEffect, useState } from 'react';

const MatchingResultPage = () => {
  const [userData, setUserData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('/api/userData'); // 백엔드 API 엔드포인트 URL로 대체
        if (!response.ok) {
          throw new Error('데이터를 불러올 수 없습니다.');
        }
        const data = await response.json();
        setUserData(data.users);
      } catch (error) {
        console.error('데이터 가져오기 오류:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div className="matchingresultpage">
      <div className="div8">운동뭉치</div>
      <div className="div9">메이트 매칭</div>
      <img
        className="matchingresultpage-child"
        alt=""
        src="/rectangle-1@2x.png"
      />
      <div className="div10">
        <p className="p">{`운동뭉치에서 여러분에게 딱 맞는 `}</p>
        <p className="p">운동 메이트를 찾아보세요!</p>
      </div>
      <img className="matchingresultpage-item" alt="" src="/rectangle-4.svg" />
      <b className="b2">빠르고 정확한 매칭을 간단하게</b>
      <div className="div11">어렵지 않게 나와 가장 잘 맞는 메이트 찾기</div>
      <div className="div12">1/3</div>
      <div className="userid">USERID님, 환영합니다!</div>
      <div className="div13">매칭결과</div>
      <div className="div14">운동 메이트 매칭 결과를 확인하세요.</div>



      {userData.map((user) => (
  <div key={user.id} className="user-profile">
    <img className="profile-picture" src={user.profilePicture} alt={`Profile of ${user.name}`} />
    <div className="user-details">
      <div className="user-name">{user.name}</div>
      <div className="user-info">
        <div className="user-gender">{user.gender}</div>
        <div className="user-age">{user.age}</div>
        <div className="user-sport">{user.sport}</div>
        <div className="user-time">{user.time}</div>
        <div className="user-days">{user.days}</div>
      </div>
    </div>
  </div>
))}

    </div>
  );
};

export default MatchingResultPage;
